SET statement_timeout = 0;
SET lock_timeout = 0;
SET idle_in_transaction_session_timeout = 0;
SET client_encoding = 'UTF8';
SET standard_conforming_strings = on;
SELECT pg_catalog.set_config('search_path', '', false);
SET check_function_bodies = false;
SET xmloption = content;
SET client_min_messages = warning;
SET row_security = off;

CREATE TABLE public.rutelinii (
    id integer NOT NULL,
    ruta character varying(10),
    geom public.geometry(LineString,4326),
    linia character varying(10),
    explicit character varying(60),
    tip character varying(10)
);


ALTER TABLE public.rutelinii OWNER TO postgres;


CREATE SEQUENCE public.rutelinii_id_seq
    AS integer
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;


ALTER TABLE public.rutelinii_id_seq OWNER TO postgres;

ALTER SEQUENCE public.rutelinii_id_seq OWNED BY public.rutelinii.id;

ALTER TABLE ONLY public.rutelinii ALTER COLUMN id SET DEFAULT nextval('public.rutelinii_id_seq'::regclass);




SELECT pg_catalog.setval('public.rutelinii_id_seq', 522, true);
CREATE INDEX rutelinii_geom_idx ON public.rutelinii USING gist (geom);



